import logo from "./logo.svg";

//import './index.css';
import Header from "./components/header";
import MacroInputs from "./components/macroInputs";


function App() {
  return (
    <div className="App">
      <div className="app-header">
        <Header />
      </div>

      <div className="my-4">
        <h1>How are calories calculated?</h1>
        <p>
          Calories are calculated from 3 main macronutrients. Carbs, Protein and Fat

          1g of carbs is equivaltent to 4 calores <br />
          1g of protein is equivaltent to 4 calores
          1g of fat is equivaltent to 9 calores
        </p>
      </div>

      <div className="app-form">
        <MacroInputs />
      </div>
    </div>
  );
}

export default App;
